import React from 'react';
import Form from './Form';

function Header() {
  return (
    <div>
      <div>
        <div>
          <Form name="name" placeholder="Name" />
        </div>
        <Form name="phone" placeholder="XXX-XXX-XXX" />
        <Form name="email" placeholder="*****@gmail.com" />
        <Form name="website" placeholder="linkedin.com/in/____" />
      </div>
    </div>
  );
}

export default Header;
